  public void PaccarFlash(object sender, DoWorkEventArgs e)
  {
    BackgroundWorker bw = sender as BackgroundWorker;
    Flasher.AddressRange addressRange = e.Argument as Flasher.AddressRange;
    if (this.isECMLiving)
    {
      this.DiagnosticSessionControl15765((byte) 129, Flasher.ECMTypes.PACCARECM);
      this.SeedKeyPACCAR((byte) 1, false, this.ecmPersonality);
      this.TesterPresent15765((byte) 1, Flasher.ECMTypes.PACCARECM);
      this.DiagnosticSessionControl15765((byte) 137, Flasher.ECMTypes.PACCARECM);
      this.ECUReset15765((byte) 2, (byte) 1, Flasher.ECMTypes.PACCARECM);
    }
    this.SeedKeyPACCAR((byte) 3, false, this.ecmPersonality);
    this.TesterPresent15765((byte) 1, Flasher.ECMTypes.PACCARECM);
    this.DiagnosticSessionControl15765((byte) 133, Flasher.ECMTypes.PACCARECM);
    this.StartDownload15765(10485760U /*0xA00000*/, (uint) ushort.MaxValue, Flasher.ECMTypes.PACCARECM);
    int sourceIndex = 0;
    int length;
    for (; sourceIndex < 65536 /*0x010000*/; sourceIndex += length)
    {
      length = sourceIndex + 769 >= 65536 /*0x010000*/ ? 65536 /*0x010000*/ - sourceIndex : 769;
      byte[] numArray = new byte[length];
      Array.Copy((Array) this.PaccarBoot, sourceIndex, (Array) numArray, 0, length);
      this.SendDownloadPacket15765(numArray, Flasher.ECMTypes.PACCARECM);
      bw.ReportProgress(sourceIndex * 100 / 65536 /*0x010000*/, (object) " Flashing Boot");
    }
    this.EndDL15765(Flasher.ECMTypes.PACCARECM);
    this.RunFromLocationPACCAR(10485760U /*0xA00000*/);
    Thread.Sleep(5000);
    this.DiagnosticSessionControl15765((byte) 129, Flasher.ECMTypes.PACCARECM);
    for (int index = 0; index < 4; ++index)
      this.TesterPresent15765((byte) 1, Flasher.ECMTypes.PACCARECM);
    bw.ReportProgress(25, (object) " Waiting");
    Thread.Sleep(5000);
    this.SeedKeyPACCAR((byte) 3, true, this.ecmPersonality);
    this.TesterPresent15765((byte) 1, Flasher.ECMTypes.PACCARECM);
    this.DiagnosticSessionControl15765((byte) 133, Flasher.ECMTypes.PACCARECM);
    bw.ReportProgress(50, (object) " Erasing");
    for (uint startAddr = addressRange.StartAddr; startAddr < 3080192U /*0x2F0000*/; startAddr += 65536U /*0x010000*/)
      this.EraseSectionPACCAR(startAddr, 65536U /*0x010000*/);
    this.EraseSectionPACCAR(3080192U /*0x2F0000*/, 61439U /*0xEFFF*/);
    byte[] InputFile = File.ReadAllBytes(addressRange.Filename);
    this.DownloadDataSection15765(bw, addressRange.StartAddr, addressRange.EndAddr - addressRange.StartAddr, 131072U /*0x020000*/, (ushort) 1000, InputFile, Flasher.ECMTypes.PACCARECM);
    this.ECUReset15765((byte) 2, (byte) 0, Flasher.ECMTypes.PACCARECM);
    e.Result = (object) "Complete";
  }

  private void DownloadDataSection15765(
    BackgroundWorker bw,
    uint StartAddress,
    uint DataLength,
    uint SectionLength,
    ushort InPacketSize,
    byte[] InputFile,
    Flasher.ECMTypes ECMType)
  {
    uint Address = StartAddress;
    uint sourceIndex = 0;
    while (Address < StartAddress + DataLength)
    {
      uint sendLength = Address + SectionLength >= StartAddress + DataLength ? StartAddress + DataLength - Address : SectionLength;
      bw.ReportProgress(Convert.ToInt32((long) (sourceIndex * 100U) / (long) InputFile.Length), (object) "Flashing");
      this.StartDownload15765(Address, sendLength, ECMType);
      uint num = 0;
      while (num < sendLength)
      {
        uint length = num + (uint) InPacketSize >= sendLength ? sendLength - num : (uint) InPacketSize;
        byte[] numArray = new byte[(int) length];
        Array.Copy((Array) InputFile, (long) sourceIndex, (Array) numArray, 0L, (long) length);
        sourceIndex += length;
        num += length;
        this.SendDownloadPacket15765(numArray, ECMType);
      }
      Address += sendLength;
      this.EndDL15765(ECMType);
    }
  }

