  private string MemByteSeekToString(byte[] InputArray, byte[] SearchArray, ushort StrLength)
  {
    for (int count = 0; count < InputArray.Length - SearchArray.Length; ++count)
    {
      if ((int) InputArray[count] == (int) SearchArray[0])
      {
        bool flag = true;
        for (int index = 1; index < SearchArray.Length; ++index)
        {
          if ((int) InputArray[count + index] != (int) SearchArray[index])
            flag = false;
        }
        if (flag)
          return Encoding.ASCII.GetString(((IEnumerable<byte>) InputArray).Skip<byte>(count).Take<byte>((int) StrLength).ToArray<byte>());
      }
    }
    return "";
  }

