  public void MaxxforceQuery(object sender, DoWorkEventArgs e)
  {
    MaxxAsyncArgs maxxAsyncArgs = e.Argument as MaxxAsyncArgs;
    if (MaxxModule.MaxxModuleProtocol(maxxAsyncArgs.Module) == ProtocolType.J1939)
    {
      this.J1939inst.RP1210_ClientConnect(maxxAsyncArgs.SelectedDevice.DeviceId, new StringBuilder("J1939"), 0, 0, (short) 0);
      this.MaxxConnectToFlashSystemJ1939();
      this.ECMSendMessage1939PGN(new byte[3]
      {
        (byte) 218,
        (byte) 254,
        (byte) 0
      }, 59904U, 3, (byte) 0);
      try
      {
        this.ecmFileName = Encoding.ASCII.GetString(this.ECMReadMessage1939(true, 20));
      }
      catch (Exception ex)
      {
        e.Result = (object) "No Response from ECM, Possible Boot Mode or Erased ECM";
        return;
      }
      e.Result = (object) $"Connected to Maxxforce ECM J1939{Environment.NewLine}Filename: {this.ecmFileName}";
    }
    else
    {
      this.J1708inst.RP1210_ClientConnect(maxxAsyncArgs.SelectedDevice.DeviceId, new StringBuilder("J1708"), 0, 0, (short) 0);
      this.MaxxConnectToFlashSystemJ1708();
      this.ECMSendMessage1708(new byte[5]
      {
        (byte) 172,
        (byte) 128 /*0x80*/,
        (byte) 240 /*0xF0*/,
        (byte) 128 /*0x80*/,
        byte.MaxValue
      }, (byte) 5);
      try
      {
        byte[] bytes = this.ECMReadMessage1708Sid(true, 20, (byte) 240 /*0xF0*/, true);
        int count = (int) bytes[2];
        this.ecmFileName = Encoding.ASCII.GetString(bytes, 3, count);
      }
      catch (InvalidDataException ex)
      {
        this.ecmFileName = "Erased ECM J1708";
      }
      catch (Exception ex)
      {
        e.Result = (object) ("Check Key Is In Run Position- " + ex.Message);
        return;
      }
      e.Result = (object) $"Connected to Maxxforce ECM J1708{Environment.NewLine}Filename: {this.ecmFileName}";
    }
  }

