  public void ECMSendMessage15765(byte[] SendPacket, int DataLength, Flasher.ECMTypes ECMType)
  {
    byte[] numArray = new byte[DataLength + 6];
    numArray[0] = (byte) 1;
    numArray[1] = (byte) 24;
    numArray[2] = (byte) 218;
    switch (ECMType)
    {
      case Flasher.ECMTypes.PACCARECM:
        numArray[3] = (byte) 0;
        numArray[4] = (byte) 249;
        break;
      case Flasher.ECMTypes.DETROITMCM:
        numArray[3] = (byte) 1;
        numArray[4] = (byte) 241;
        break;
      case Flasher.ECMTypes.DETROITCPC:
        numArray[3] = (byte) 0;
        numArray[4] = (byte) 241;
        break;
      case Flasher.ECMTypes.DETROITACM:
        numArray[3] = (byte) 61;
        numArray[4] = (byte) 241;
        break;
      default:
        throw new Exception("ECM Type Not Specified");
    }
    numArray[5] = (byte) 0;
    Array.Copy((Array) SendPacket, 0, (Array) numArray, 6, DataLength);
    int num = (int) this.ISO15765inst.RP1210_SendMessage(numArray, (short) (DataLength + 6), (short) 0, (short) 1);
  }

