  private byte[] ECMReadMessage15765(bool Blocking, int RetryCount)
  {
    int num = 0;
    byte[] sourceArray;
    do
    {
      sourceArray = !Blocking ? this.ISO15765inst.RP1210_ReadMessage((short) 0) : this.ISO15765inst.RP1210_ReadMessage((short) 1);
      ++num;
      if (num >= RetryCount)
        throw new Exception("Communication Error:  No Responses from ECM");
    }
    while (sourceArray.Length == 0 || sourceArray[4] == (byte) 1 || sourceArray[4] == (byte) 2);
    short length = (short) (sourceArray.Length - 11);
    byte[] destinationArray = new byte[(int) length];
    Array.Copy((Array) sourceArray, 11, (Array) destinationArray, 0, (int) length);
    return destinationArray;
  }

