  private byte[] ECMReadMessage1708Sid(bool Blocking, int RetryCount, byte Sid, bool CountCheck)
  {
    byte[] numArray;
    if (CountCheck)
    {
      int num = 0;
      do
      {
        numArray = this.ECMReadMessage1708(Blocking, RetryCount);
        if (numArray.Length == 0)
          throw new Exception("No Response from ECM");
        ++num;
        if (num > 20)
          throw new InvalidDataException("Module Response - No MID");
      }
      while ((int) numArray[1] != (int) Sid);
    }
    else
    {
      do
      {
        numArray = this.ECMReadMessage1708(Blocking, RetryCount);
        if (numArray.Length == 0)
          throw new Exception("No Response from ECM");
      }
      while ((int) numArray[1] != (int) Sid);
    }
    return numArray;
  }

