  public void Sniffer(object sender, DoWorkEventArgs e)
  {
    BackgroundWorker backgroundWorker = sender as BackgroundWorker;
    SnifferArgs snifferArgs = e.Argument as SnifferArgs;
    DeviceInfo selectedDevice = snifferArgs.SelectedDevice;
    bool j1708Sniff = snifferArgs.J1708Sniff;
    bool j1939Sniff = snifferArgs.J1939Sniff;
    byte[] fpchClientCommand = new byte[2]
    {
      (byte) 200,
      (byte) 1
    };
    if (j1708Sniff)
    {
      this.J1708inst.RP1210_ClientConnect(selectedDevice.DeviceId, new StringBuilder("J1708"), 0, 0, (short) 0);
      this.J1708inst.RP1210_SendCommand(RP1210_Commands.RP1210_Set_BlockTimeout, fpchClientCommand, (short) 2);
      this.J1708inst.RP1210_SendCommand(RP1210_Commands.RP1210_Set_All_Filters_States_to_Pass, (byte[]) null, (short) 0);
    }
    if (j1939Sniff)
    {
      this.J1939inst.RP1210_ClientConnect(selectedDevice.DeviceId, new StringBuilder("J1939"), 0, 0, (short) 0);
      this.J1939inst.RP1210_SendCommand(RP1210_Commands.RP1210_Set_BlockTimeout, fpchClientCommand, (short) 2);
      this.J1939inst.RP1210_SendCommand(RP1210_Commands.RP1210_Set_All_Filters_States_to_Pass, (byte[]) null, (short) 0);
    }
    StreamWriter streamWriter = new StreamWriter("Output.txt");
    backgroundWorker.ReportProgress(0, (object) "Sending To Output.txt");
    do
    {
      if (j1708Sniff)
      {
        byte[] source = this.ECMReadMessage1708(true, 20);
        streamWriter.WriteLine(BitConverter.ToString(((IEnumerable<byte>) source).ToArray<byte>()));
        streamWriter.Flush();
        backgroundWorker.ReportProgress(0, (object) BitConverter.ToString(((IEnumerable<byte>) source).ToArray<byte>()));
      }
      if (j1939Sniff)
      {
        byte[] source = this.ECMReadMessage1939(true, 20);
        backgroundWorker.ReportProgress(0, (object) BitConverter.ToString(((IEnumerable<byte>) source).ToArray<byte>()));
      }
    }
    while (!backgroundWorker.CancellationPending);
    streamWriter.Close();
  }

